script: |
  super -f text -I q5525.spq | sort > q5525.out

inputs:
  - name: q5525.spq
    data: |
      SELECT + 1 FROM tab0 (FORMAT parquet) WHERE + + 89 * + col1 NOT IN ( - col1 * ( 87 ), col1 + - col2 - - col1 * - col0 * col0 );
  - name: tab0

outputs:
  - name: q5525.out
    data: |
      1
      1
      1
